import './assets/style/style.scss'

import Header from './components/Header';
import Hero from './components/Hero';
import './assets/images/hero.png'
import Services from './components/Services';
import Auto_tire from './components/Popular tires';
import Auto_discs from './components/Auto_discs';
import Shares from './components/Shares';
import About from './components/About';
import Footer from './components/Footer';
import Truck_tire from './components/Truck_tire';
import Discs from './components/Discs';
import Moto_tire from './components/Moto_tire'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'

function App() {
  return (
   <div>
      <Header/>
        <Hero/>
         <Services/>
           <Router>
             <Popu/>
                <Routes>
                   <Route path='/' element={<Discs/>}/>
                   <Route path='/trucktire' element={<Truck_tire/>}/>
                   <Route path='/b' element={<Moto_tire/>}/>
                </Routes>
           </Router>
          <Auto_discs/>
         <Shares/>
       <About/>
     <Footer/>
</div>
  );
}

export default App;
